  false,\n\t\"url\": null,\n\t\"notes\": \"The \"What do I do with...?\" site (http://your.kingcounty.gov/solidwaste/wdidw/index.asp)
  provides King County citizens with recycling and proper disposal options for over
  100 products and materials. The site lists over 400 businesses (mostly local) that
  accept products and materials for recycling or proper disposal. Business details
  include location (with mapping), contact information, hours of operation, restrictions,
  fees and more. The goal of \"What do I do with...?\" is to reduce the volume of
  reusable or recyclable items being added to the waste-stream, thereby reducing the
  environmental impact of those items while extending the lifespan of our landfills.\",\n\t\"license_title\":
